function App(){
  const [todos, setTodos] = React.useState([
    {
      text: 'learn react',
      isCompleted: false,
    },
    {
      text: 'meet friend for lunch',
      isCompleted: false,
    },
    {
      text: 'build todo app',
      isCompleted: false,
    }        
  ]);

  return(<>
    {todos.map((todos,i) => <div key={i}>{todos.text}</div>)}
    </>);
}

ReactDOM.render(
  <App/>,
  document.getElementById('root')
);
